(2, '<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<h3><strong>Welcome to Boardspeck</strong></h3>\r\n\r\n<p>Boardspeck is a platform for diverse insightful experiences where everyone can engage with various&nbsp;line of interest. Authors can&nbsp;publish articles , event organizers can&nbsp; manage and promote their events,&nbsp; trainers&nbsp; can list and manage their trainings . Various tools and feature are available to ensure a worth&nbsp;experience on our platform. Our mission is to promote meaningful engagements across the Globe.</p>\r\n\r\n<p>Visit <a href=\"https://boardspeck.com/blog\" target=\"_blank\">https://boardspeck.com/blog</a> to learn more about our features</p>\r\n</blockquote>', 'admin7115698293', 'j90819542aBn72i', '2018-03-07', '17:09:32');
